import {Route, Routes} from "react-router-dom";
import LoginPage from "./pages/LoginPage/LoginPage";
import SignupPage from "./pages/SignupPage/SignupPage";
import StudentViewPage from "./pages/StudentViewPage/StudentViewPage";
import InstructorViewPage from "./pages/InstructorViewPage/InstructorViewPage";
import EvaluationQuestionsPage1 from "./pages/EvaluationQuestionsPage1/EvaluationQuestionsPage1";
import CreateEvaluationQuestionsPage from "./pages/CreateEvaluationQuestionsPage/CreateEvaluationQuestionsPage";
import SubmittedEvaluationsPage from "./pages/SubmittedEvaluationsPage/SubmittedEvaluationsPage";
import CreatedEvaluationsPage from "./pages/CreatedEvaluationsPage/CreatedEvaluationsPage";
import EvaluationQuestionsPage2 from "./pages/EvaluationQuestionsPage2/EvaluationQuestionsPage2";
import { ThemeProvider} from '@material-ui/core/styles';
import theme from "./components/ui/Theme"

const App = () => {
    return (
        <ThemeProvider theme={theme}>
          <Routes>
              <Route path='/' exact element={<LoginPage/>}/>
              <Route path='/signup' exact element={<SignupPage/>}/>
              <Route path='/studentView' exact element={<StudentViewPage/>}/>
              <Route path='/instructorView' exact element={<InstructorViewPage/>}/>
              <Route path='/evaluationQuestions1' exact element={<EvaluationQuestionsPage1/>}/>
              <Route path='/evaluationQuestions2' exact element={<EvaluationQuestionsPage2/>}/>
              <Route path='/createEvaluation' exact element={<CreateEvaluationQuestionsPage/>}/>
              <Route path='/submittedEvaluations' exact element={<SubmittedEvaluationsPage/>}/>
              <Route path='/createdEvaluations' exact element={<CreatedEvaluationsPage/>} />
          </Routes>
        </ThemeProvider>

  );
}

export default App;
